from collections import deque
class Solution:
    def findLength(self, nums1, nums2):
        dp = [[0 for _ in range(len(nums1)+1)] for _ in range(len(nums2)+1)]
        l = 0
        for i in range(len(nums1)+1):
            for j in range(len(nums2)+1):
                if i == 0 or j == 0:
                    dp[i][j] = 0
                elif nums1[i-1] == nums2[j-1]:
                    dp[i][j] = dp[i-1][j-1] + 1
                    l = max(dp[i][j], l)
                else:
                    dp[i][j] = 0
        return l


